/*Table structure for table `wy_config_parameter` */

DROP TABLE IF EXISTS `wy_config_parameter`;

CREATE TABLE `wy_config_parameter` (
  `param_id` int(11) NOT NULL DEFAULT '0' COMMENT '系统公共参数编号',
  `param_parent_id` int(11) DEFAULT NULL COMMENT '系统公共参数父级编号（参数存在多级过滤时使用）',
  `param_type` int(11) NOT NULL COMMENT '系统参数类型编号',
  `param_status` int(11) DEFAULT '1' COMMENT '系统参数状态',
  `table_code` varchar(100) NOT NULL COMMENT '系统参数对应的表名（数据库角度）',
  `table_name` varchar(100) DEFAULT NULL COMMENT '系统参数对应的表名（中文名）',
  `column_code` varchar(100) NOT NULL COMMENT '系统参数对应表中的字段（数据库角度）',
  `column_name` varchar(100) DEFAULT NULL COMMENT '系统参数对应表中的字段（中文名）',
  `option_value` int(11) NOT NULL COMMENT '系统参数选项的值',
  `option_name` varchar(500) DEFAULT NULL COMMENT '系统参数选项的中文名',
  PRIMARY KEY (`param_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

