/*Table structure for table `wy_info_article` */

DROP TABLE IF EXISTS `wy_info_article`;

CREATE TABLE `wy_info_article` (
  `article_id` bigint(20) NOT NULL COMMENT '文章内部id',
  `title` varchar(300) NOT NULL COMMENT '标题',
  `digest` varchar(600) DEFAULT NULL COMMENT '摘要',
  `send_time` datetime NOT NULL COMMENT '待发布时间',
  `type` int(11) DEFAULT NULL COMMENT '文章类型 1-新闻、2-通知、3-公告、4-工作简报',
  `tags` varchar(200) DEFAULT NULL COMMENT '文章标签，多个标签逗号分隔',
  `status` int(11) DEFAULT NULL COMMENT '文章状态 0-停用、1-启用',
  `thumbnail` varchar(200) DEFAULT NULL COMMENT '缩略图地址',
  `content` mediumtext COMMENT '正文',
  `ext_url` varchar(500) DEFAULT NULL COMMENT '正文外部链接',
  `url` varchar(500) DEFAULT NULL COMMENT '正文链接',
  `publisher_id` bigint(20) NOT NULL COMMENT '发布者id',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `last_update_time` datetime NOT NULL COMMENT '最后更新时间',
  `update_user_id` bigint(20) NOT NULL COMMENT '更新者id',
  `publish_name` varchar(20) DEFAULT NULL COMMENT '发布者展示名',
  PRIMARY KEY (`article_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

/*Data for the table `wy_info_article` */

insert  into `wy_info_article`(`article_id`,`title`,`digest`,`send_time`,`type`,`tags`,`status`,`thumbnail`,`content`,`ext_url`,`url`,`publisher_id`,`create_time`,`last_update_time`,`update_user_id`,`publish_name`) values (35531372866016,'八举措推进物业服务健康发展','服务涉及千家万户，事关群众的切身利益，事关社会的和谐稳定，是一项社会关注度高的民生工作。楚雄市委、市政府高度重视，采取多项措施支持服务物业服务行业健康有序发展','2017-10-09 00:00:00',1,'新闻',1,'http://222.178.152.37:8084/m/news/n1.png','fdsggfdgs3',NULL,'http://222.178.152.37:8084/m/news/news1.html',0,'2017-12-05 11:31:03','2017-12-06 11:31:11',0,NULL),(35531390751280,'组织居民参加技能培训','了全面贯彻落实再就业政策，关心支持辖区无业人员，提高辖区无业人员就业能力，营造一个良好的再就业环境，8月9日上午，同德社区组织失业人员、退休居民参加 “面点培训班”','2017-10-11 00:00:00',1,'新闻',1,'http://222.178.152.37:8084/m/news/n2.png','fdsggfdgs3',NULL,'http://222.178.152.37:8084/m/news/news2.html',0,'2017-12-05 11:31:05','2017-12-06 11:31:15',0,NULL),(35531403929704,'互联网＋家居”来了 市民家装更省钱了','VR体验装修设计效果、手机APP上随时查看装修情况……4月7日，曲靖“非凡生活家居综合主题馆”带着“互联网+”的思维、模式在曲靖经开区人民工社落地','2017-10-11 00:00:00',1,'新闻',1,'http://222.178.152.37:8084/m/news/n3.png','fdsggfdgs3',NULL,'http://222.178.152.37:8084/m/news/news3.html',0,'2017-12-05 11:31:07','2017-12-06 11:31:42',0,NULL),(35586875176112,'【聚焦】激发活力 重庆公示第一批9个“互联网+”产业基地','“互联网+”时代来临 我们的生活 不止是手机、电脑、iPad 还有无人驾驶、快捷支付、人脸识别','2017-12-28 16:57:00',1,'便民资讯',1,'http://oyzgunhd3.bkt.clouddn.com/FhP3M-dPjoagkmAw7dc7HWhD-Awe','<p><span style=\"color: rgb(62, 62, 62);\">“互联网+”时代来临</span></p><p><span style=\"color: rgb(62, 62, 62);\">我们的生活</span></p><p><span style=\"color: rgb(62, 62, 62);\">不止是手机、电脑、iPad</span></p><p><span style=\"color: rgb(62, 62, 62);\">还有无人驾驶、快捷支付、人脸识别</span></p><p><span style=\"color: rgb(62, 62, 62);\">……</span></p><p><img src=\"http://oyzgunhd3.bkt.clouddn.com/FkApoa9l5ng305BfPtNtuDyisly5\"></p><p><span style=\"color: rgb(62, 62, 62);\">这些“黑科技”</span></p><p><span style=\"color: rgb(62, 62, 62);\">不止是大家的生活技能</span></p><p><span style=\"color: rgb(62, 62, 62);\">也是“互联网+”企业发展的重点</span></p><p><span style=\"color: rgb(62, 62, 62);\">要做“互联网+”企业</span></p><p><span style=\"color: rgb(62, 62, 62);\">当然要选个好地方落户</span></p><p><span style=\"color: rgb(62, 62, 62);\">今天</span></p><p><strong style=\"color: rgb(186, 26, 0);\">重庆市经信委发布了</strong></p><p><strong style=\"color: rgb(186, 26, 0);\">重庆市“互联网+”产业基地创建公示名单</strong></p><p><img src=\"http://oyzgunhd3.bkt.clouddn.com/FsGeWFmjxVynWvyrcGAKgI5jYC5K\"></p><p><span style=\"color: rgb(62, 62, 62);\">市经信委公布了9个备选的“互联网+”产业基地申报单位进入公示名单，公示时间为5个工作日（从2017年12月19日至2017年12月25日止）。公示完成后，这9个申报单位将正式启动重庆市“互联网+”产业基地的创建工作。</span></p><p><img src=\"http://oyzgunhd3.bkt.clouddn.com/Fszur7j4IaT3m1vY57nmRQzBS55d\"></p><p><strong style=\"color: rgb(62, 62, 62);\">入选“互联网+”产业基地，意味着什么？</strong></p><p><br></p><p><span style=\"color: rgb(62, 62, 62);\">打造产业集聚区</span></p><p><br></p><p><span style=\"color: rgb(62, 62, 62);\">大力支持和鼓励引入优秀互联网龙头企业落户，培育有实力的中小企业壮大为骨干企业，围绕“互联网+”有关领域延伸产业链条，形成专业化分工、上下游协作的产业链，加快形成产业集聚发展。</span></p><p><br></p><p><span style=\"color: rgb(62, 62, 62);\">培育“互联网+”新业态</span></p><p><br></p><p><span style=\"color: rgb(62, 62, 62);\">培育发展基于互联网的云计算服务、大数据服务、电子商务服务、地理信息服务、数字内容服务、人工智能服务等新业态。推动互联网企业向经济社会各领域加速渗透，发展云设计、云制造和网络协同制造、个性化定制、云安全、云支付、O2O营销等互联网新模式。</span></p><p><img src=\"http://oyzgunhd3.bkt.clouddn.com/FjkJKH73BzOnff-UgEXX_qVRPF6O\"></p><p><span style=\"color: rgb(62, 62, 62);\">未来，重庆将着力建成一批基础设施完备、服务功能齐全、社会经济效应突出、示范带动作用强的“互联网+”产业基地，进一步促进互联网相关产业加速集聚和创新提升，推动互联网相关产业与经济社会各领域的融合互动发展。</span></p>',NULL,'http://static.sopcloud.net/news/35586875176112.html?r=1514452031760',9189555458984,'2017-12-28 17:07:12','2017-12-28 17:07:12',9189555458984,'品牌管理中心'),(35586951379944,'告诉大家一个好消息','2017年只有最后一周啦！去年定下的目标都实现了多少呢？','2017-12-28 19:45:00',1,'社区动态',1,'http://oyzgunhd3.bkt.clouddn.com/FlMYnmptTeVOUirfwYX4vSVQILUJ','<p><span style=\"color: rgb(85, 79, 79);\">2017年只有最后一周啦！去年定下的目标都实现了多少呢？</span></p><p><span style=\"color: rgb(63, 63, 63);\">打造重庆最安全小区</span></p><p><span style=\"color: rgb(63, 63, 63);\">小区进行品质升级</span></p><p><span style=\"color: rgb(63, 63, 63);\">智慧社区开始试点</span></p><p><span style=\"color: rgb(63, 63, 63);\">举办更多精彩的社区活动</span></p><p><span style=\"color: rgb(63, 63, 63);\">提升业主居住幸福感</span></p><p><span style=\"color: rgb(63, 63, 63);\">......</span></p><p><span style=\"color: rgb(85, 79, 79);\">这一年，在业主“鹏”友的大力支持下，新鸥鹏物业创造了很多新成绩。</span></p><p><br></p><p><span style=\"color: rgb(85, 79, 79);\">12月21日，再次传来一个好消息，由人民网/中国新闻网/重庆市总工会/重庆时报联合举办的《2017重庆城市推介力暨第十一届城市建设贡献总评榜》权威发布，新鸥鹏物业凭借这一年的努力，获评2017年度金牌物业奖。</span></p><p><br></p><p><span style=\"color: rgb(85, 79, 79);\">这份荣誉属于所有业主与新鸥鹏物业人，感谢业主在这一年中对于我们工作的鼓励和鞭策，感谢每一位在岗位上辛勤付出的鸥鹏物业人。</span></p><p><br></p><p><span style=\"color: rgb(85, 79, 79);\">来年，我们还将不断超越，为业主“鹏”友提供更贴心的服务，不辜负大家的期待。</span></p><p><img src=\"http://oyzgunhd3.bkt.clouddn.com/FnnSs851ii7zZdyc0BuRR8KroXHf\"><img src=\"http://oyzgunhd3.bkt.clouddn.com/FsFTudQyN5yGh-tpPerpVgYfcdRs\"></p>',NULL,'http://static.sopcloud.net/news/35586951379944.html?r=1514461557235',9189555458984,'2017-12-28 19:45:57','2017-12-28 19:45:57',9189555458984,'集团'),(35587443749896,'工程师傅护航，最后一分钟将学生送进考场','12月16日下午，南译渝北校区正在进行全国大学生英语六级考试，考试即将开始，考生陆续进入考场。','2017-12-29 12:49:00',1,'社区动态',1,'http://oyzgunhd3.bkt.clouddn.com/FrZr_AFqEEmEtoRTJ_yy_ePkVG9M','<p>12月16日下午，南译渝北校区正在进行全国大学生英语六级考试，考试即将开始，考生陆续进入考场。</p><p>此时，一位进入考场的女生发现自己没带身份证，眼看考试时间即将来临，此时的女生心急如焚，如果再返回宿舍拿，肯定来不及了。</p><p>这时，新鸥鹏物业中心工程部的李崇万师傅刚好路过，得知情况后，骑着摩托护送女生到宿舍取回身份证，在考试前一分钟顺利将考试女生送进了考场，从而避免了因迟到而“弃考”的事情发生！<img src=\"http://oyzgunhd3.bkt.clouddn.com/FrxBf8OBVSfiDzo2NueicxFPTAFp\"><img src=\"http://oyzgunhd3.bkt.clouddn.com/Fp782UgNI6v93SY3yqGnvLMjG0l1\"></p><p><img src=\"http://oyzgunhd3.bkt.clouddn.com/FgcHXltFsa8PccO9bOm3f7nWySO4\"></p>',NULL,'http://static.sopcloud.net/news/35587443749896.html?r=1514524863543',9149437928696,'2017-12-29 12:51:43','2017-12-29 12:51:43',9149437928696,''),(35587447513248,'迎新年，庆佳节--新鸥鹏物业2018迎新系列活动拉开序幕','临近新年时节，新鸥鹏物业中心将开展了一系列的迎新活动，让业主能够感受到新鸥鹏温暖的家文化。','2017-12-29 12:53:00',1,'社区活动',1,'http://oyzgunhd3.bkt.clouddn.com/Frjwa8qIajecxNxaKp5Yx9ikbU3n','<p>临近新年时节，新鸥鹏物业中心将开展了一系列的迎新活动，让业主能够感受到新鸥鹏温暖的家文化。</p><p><strong>活动第一波：平安夜 | 圣诞节 | 元旦&nbsp;点亮新光</strong></p><p>虽说是西洋节日，但形式不重要，一家人在一起的氛围才重要。</p><p>灯笼DIY&amp;亮灯仪式，点亮2018年的希望。</p><p><strong>活动第二波：腊八节 | 分享腊八</strong></p><p>八方食物合在一块，和米共煮一锅，是合聚万物、调和千灵之意。</p><p>腊八节，我们将准备好丰盛的腊八粥，您可以在小区免费领取。</p><p><strong>活动第三波：小年夜 | 家宴盛会</strong></p><p>聊着过去，盼着将来，用一份年夜饭菜单记录这一年。</p><p>12道家宴，面向所有业主征集家宴菜品，和邻居一起筹备社区年夜饭，公布2018年新鸥鹏专属年夜饭菜单，您的菜有可能会入选哟！</p><p><strong>活动第四波：除夕 | 新年送福</strong></p><p>赠对联，贴福字，欢声、笑语，过新年。</p><p>除夕节，我们将免费派送对联及福字，邀您一起红红火火贺新年。</p><p><strong>活动第五波：元宵 | 元宵团圆</strong></p><p>喝杯热茶，吃口汤圆，与您分享这团圆的欢喜。</p><p>元宵节当天，我们将准备热腾腾的汤圆，邀您一起品尝团团圆圆。</p><p><img src=\"http://oyzgunhd3.bkt.clouddn.com/Frjwa8qIajecxNxaKp5Yx9ikbU3n\"></p>',NULL,'http://static.sopcloud.net/news/35587447513248.html?r=1514523573843',9149437928696,'2017-12-29 12:59:34','2017-12-29 12:59:34',9149437928696,''),(35587450236368,'28日起重庆新增11对动车 到天津只需12个小时','来自重庆火车站消息，12月19日，重庆火车站发布铁路年底过渡图，重庆新增动车11对，分别开往西安、天津、太原，其中前往天津、太原的直通动车是首次开行。','2017-12-29 13:01:00',1,'便民资讯',1,'http://oyzgunhd3.bkt.clouddn.com/FspgNbdKmeW11iLN0hs74aNbEPbV','<p><img src=\"http://oyzgunhd3.bkt.clouddn.com/FtqvgidgLtH_G8AY94iU1ahdIX58\"></p><p>来自重庆火车站消息，12月19日，重庆火车站发布铁路年底过渡图，重庆新增动车11对，分别开往西安、天津、太原，其中前往天津、太原的直通动车是首次开行。</p><p><strong>首次开行前往天津太原直通动车</strong></p><p><strong><span class=\"ql-cursor\">﻿</span></strong><img src=\"http://oyzgunhd3.bkt.clouddn.com/FnSAMAK_JIyoqb0nnogwViUvLJY8\"></p><p>据悉，铁路年底过渡图新增直通动车11对，其中新增重庆北至西安北7对。渝贵铁路开通前，重庆北站临时调整增开重庆北至天津西1对，重庆北至太原南3对，重庆北至天津西、太原南是首次开行直通动车。另外，新增D4181/2汉口至重庆北动车组高峰线1对。</p><p><strong>4趟列车停运，2趟列车变更运行区段</strong></p><p>另外，停运4对列车，分别是：成都东至广州南G314/1、G312/3次1对；广州南至成都东G1316/7、G1318/5次1对；重庆至昆明K167/8次1对；重庆北至呼和浩特东K1536/5次1对。</p><p>变更运行区段2对。成都东至北京西G310/09次运行区段调整为重庆北至北京西，车次仍为G310/09次；桂林北至成都东K651/4/1、K652/3/2次运行区段调整为南宁至成都东，车次改为K654/1、K652/3次。</p><p><strong>调整图过渡期至12月31日</strong></p><p>特快和快速货运班列调整图自12月28日零时起实行。其他货物列车调整图自12月27日18时起实行。调整图过渡期为12月25日至12月31日。涉及渝贵线及相关联络线、动车所、沙坪坝等新开通线路运行图实施时间另行确定。</p>',NULL,'http://static.sopcloud.net/news/35587450236368.html?r=1514523914233',9149437928696,'2017-12-29 13:05:14','2017-12-29 13:05:14',9149437928696,''),(35587451840160,'冬季养生，我们不曾留意过的误区','寒冷的冬季并不可怕，正是锻炼我们身体机能的好时节，不要把自己想象的太娇气了，比如穿厚厚的棉衣，睡觉用电热毯等习惯都不适合身体免疫力的增强，除此之外，还有哪些我们没有留意的“误区”？','2017-12-29 13:10:00',1,'生活百科',1,'http://oyzgunhd3.bkt.clouddn.com/Foi6vn-BUeNUWudkcODmaMgsepkN','<p>寒冷的冬季并不可怕，正是锻炼我们身体机能的好时节，不要把自己想象的太娇气了，比如穿厚厚的棉衣，睡觉用电热毯等习惯都不适合身体免疫力的增强，除此之外，还有哪些我们没有留意的“误区”？</p><p><strong>误区一：喝酒暖身</strong></p><p>到了冬天，很多人都习惯喝点小酒来暖暖身，但这种做法并不明智。</p><p>喝了酒之后会感觉暖和，是因为酒精会麻醉人体的中枢系统，从而产生的错觉。实际上，喝了酒之后人的体温反而下降了。因为皮肤下的微细血管因饮酒而迅速扩张，血液由于表面扩大而较快地降温，体温也因而下降了。</p><p><img src=\"http://oyzgunhd3.bkt.clouddn.com/Foi6vn-BUeNUWudkcODmaMgsepkN\"></p><p><strong>误区二：喝咖啡</strong></p><p>咖啡是很多女性喜爱的饮品，稍感倦意的冬日午后，冲泡一杯咖啡，不仅感觉温暖，还可以让人提神。</p><p>热热的咖啡看上去似是提高体温的佳品，但实际上，咖啡的原料原料为产于南方的植物，属阴性，会让人的体温下降。而且，咖啡中过多的咖啡因会阻碍糖类的吸收，从而导致身体的新陈代谢下降，加剧手脚冰凉。</p><p>同时，咖啡因摄入量过多，会增进对体内贮存的B族维生素的耗损，从而加剧因体寒引起的失眠、痛经等症状。</p><p><img src=\"http://oyzgunhd3.bkt.clouddn.com/FlMLV1b8kyRrEHyP1KC3hzWwS-0a\"></p><p><strong>误区三：穿厚厚的棉衣</strong></p><p>感觉寒冷的时候，很多女性的第一反应是穿上更加厚重的衣服，以抵挡寒气入侵。</p><p>但其实，太厚的衣服不仅不利于保暖，还不利健康。因为厚厚的衣物会妨碍皮肤正常的“呼吸”和汗液的蒸发，容易引起瘙痒、干燥等症状。</p><p>衣服对肌肉的压迫和摩擦还会影响血液循环，造成体表热量减少，这种情况下即使盖上厚被子也会感到冷，容易感冒。</p><p><span style=\"color: rgb(64, 64, 64);\">（图名称：误区3）</span></p><p><strong>误区四：紧关门窗</strong></p><p>有些人一到冬天就将家里门窗紧关，以为这样室内温度更高，有利保暖。其实不然。</p><p>专家介绍，人体在新陈代谢过程中会产生500余种化学物质，而仅从呼吸道排出的就有149种之多。空气中有大量的细菌、病毒、二氧化碳和灰尘，在这样的空气中，人容易感冒、咳嗽，所以应该经常开窗，保持空气新鲜。</p><p><img src=\"http://oyzgunhd3.bkt.clouddn.com/FsTh06Mo3OHRte7XHLMIR9WsuN1n\"></p><p><strong>误区五：睡觉用电热毯</strong></p><p>深度睡眠时保暖很重要。然而将全身都暖和起来的电热毯，会令身体产生依赖，导致身体自身产生热量的能力降低。</p><p>相比电热毯，热水袋是你的更好选择。因为热水袋在将人体血液运行调至最佳状态后温度下降，无损于人体自身产生热量的能力。</p><p><img src=\"http://oyzgunhd3.bkt.clouddn.com/FmEdC7QHPvbTTW_NfiPgGZaj-6s6\"></p><p><strong>误区六：用温度过高的热水洗脸</strong></p><p>怕冷的女性在冬季一般会选择用热水洗脸，但是一旦温度过高，就极容易对皮肤造成伤害。</p><p>冬天，人的面部在冷空气刺激下，汗腺和毛细血管都呈收缩状态，当遇上热水时会迅速扩张，但热量散发后，又恢复低温时的状态。毛细血管这样一张一缩，容易使人感觉面部皮肤紧绷干燥，还会使皮肤容易产生你最怕看到的皱纹。</p><p>正确的方法是最好能用冷热水交替洗脸，这可以逐渐加快皮肤的血液循环，还能起到如同按摩的作用。</p><p><img src=\"http://oyzgunhd3.bkt.clouddn.com/FoPWtmcBuhyuu53u7ye9z8f8A5c3\"></p><p><strong>误区七：蒙头睡觉</strong></p><p>有些人习惯把头蒙在被窝里睡觉，感觉上暂时可能会暖和些。但其实，被窝里的氧气会越来越少，二氧化碳和不洁气体却越积越多，所以蒙头大睡以后，你经常会感到昏昏沉沉的，全身疲乏无力。</p><p><img src=\"http://oyzgunhd3.bkt.clouddn.com/FjkIKtpjqBcbiQOwiIo80xnYarHE\"></p><p><strong>误区八：皮肤发痒就用手挠</strong></p><p>冬天因皮肤干燥会感觉到痒，建议不要用手抓，否则容易引起皮肤感染。建议多吃蔬菜水果，严重者买药膏涂抹。</p><p><img src=\"http://oyzgunhd3.bkt.clouddn.com/FsTfKZbDYhKWPWuCOpxi3neXZcvX\"></p>',NULL,'http://static.sopcloud.net/news/35587451840160.html?r=1514524114708',9149437928696,'2017-12-29 13:08:35','2017-12-29 13:08:35',9149437928696,''),(35587455258984,'打造行业标准，树立物业服务典范----市人大、市政协领导高度肯定新鸥鹏物业服务','11月23日和24日，市人大、市政协、市国土房管局、铜梁区人民政府、铜梁区国土房管局、巴南区国土房管局等领导相继检验了壹號公舘、御景天下、融智学院，对新鸥鹏物业服务给予高度评价。','2017-12-29 13:10:00',1,'集团要闻',1,'http://oyzgunhd3.bkt.clouddn.com/Fqf3emBYYcCL0Ea7cYIcwEv5wEeY','<p>11月23日和24日，市人大、市政协、市国土房管局、铜梁区人民政府、铜梁区国土房管局、巴南区国土房管局等领导相继检验了壹號公舘、御景天下、融智学院，对新鸥鹏物业服务给予高度评价。</p><p><strong>壹號公舘、御景天下：维护及现场管理已达市优标准</strong></p><p>11月24日下午，创优评审小组先后检验了铜梁壹號公舘及御景天下，包括门岗的防护措施、公共区域的绿化保洁，配电房、水泵房以及中控室等设施设备维护、养护情况，评审小组进行了聆听、询问，称赞新鸥鹏物业管理“工作到位，维护、管理均达到市优标准”，尤其是对安保及保洁工作给予高度评价。</p><p><img src=\"http://oyzgunhd3.bkt.clouddn.com/Fh5ucI_gfTttJ-Ivrc-VB6NGVJaj\"></p><p>同时，评审小组提出：希望新鸥鹏物业管理集团在保持高水准服务基础之上，继续加强公共设施设备的管理，积极开展智慧化社区建设工作，为业主提供更优质、更便捷的服务。</p><p><img src=\"http://oyzgunhd3.bkt.clouddn.com/Fl87wTURAXKpkL7MNBhRb4O0Bm4W\"></p><p><strong>融智学院：现场管理到位，增值服务贴心</strong></p><p>11月23日上午，巴南区评审小组检验了重庆工商大学融智学院，先后参观了门岗值班记录、学生公寓、食堂、教学楼以及部分公共设施设备，对新鸥鹏物业的服务水准给予高度评价。</p><p>评审小组在听取了新鸥鹏物业管理集团对教育物业服务模式的介绍及未来构想，还建议我司密切关注房管局下发的新政策、新规定，并组织学习，掌握最新动态，并落实到具体工作中。</p><p>今年是新鸥鹏物业管理集团集中推进优秀示范小区的第一年，2018年将继续推进此项工作，为新鸥鹏物业服务赢得良好行业口碑。</p>',NULL,'http://static.sopcloud.net/news/35587455258984.html?r=1514524542061',9149437928696,'2017-12-29 13:15:42','2017-12-29 13:15:42',9149437928696,''),(35610405780784,'寻找年味，重庆民俗活动好戏连台','不经意间，春节已经临近。1月30日，重庆日报记者从多个区县获悉，春节前后，我市各种民俗活动好戏连台，如苗家长桌宴、杂技表演、灯展、佛灯艺术节、诗词灯会等，市民可以来一趟欢乐的“寻年味”之旅。','2018-01-31 18:05:00',1,'便民资讯',1,'http://oyzgunhd3.bkt.clouddn.com/FsKP_PjKfX2BsVURRXDl8hcpjyYZ','<p class=\"ql-align-center\"><img src=\"http://i4.cqnews.net/cqtoday/attachement/jpg/site82/20180131/7824af31e19d1bdb4b3255.jpg\"></p><p class=\"ql-align-center\">1月19日，游客在重庆合川三江灯会上观赏彩灯。新华社发</p><p>不经意间，春节已经临近。1月30日，重庆日报记者从多个区县获悉，春节前后，我市各种民俗活动好戏连台，如苗家长桌宴、杂技表演、灯展、佛灯艺术节、诗词灯会等，市民可以来一趟欢乐的“寻年味”之旅。</p><p><strong> 綦江</strong></p><p><strong> 观版画展购年货</strong></p><p>綦江版画，被誉为“木板上的民间智慧，画纸上的乡村史诗”。</p><p>1月28日，第十九届全国少儿版画展暨第三届全国教师版画展在綦江区风华美术馆和农民版画院同步开展，400件作品将火锅、酸菜鱼、吊脚楼、桥、洪崖洞、观音桥、磁器口、解放碑等众多元素汇集画中，画风或幽默稚拙、或热情奔放，引人入胜。</p><p>“本届版画展将持续到3月31日。”綦江区委宣传部相关负责人称，除了版画展，该区首届菜坝网年货美食节也正如火如荼地举行，北渡鱼、缠丝芋儿酥、凤凰山药蛋、刘氏黑鸭……2000余种当地特色年货商品，让游客选择多多。此外，土猪、山羊、土鸡、土鸭等活物类产品，游客都可在现场或网上下单后，经屠宰加工后快递到家。</p><p><strong> 彭水</strong></p><p><strong> 品味苗家文化</strong></p><p>彭水蚩尤九黎城是世界上最宏大的苗族建筑群之一，创下了多个世界之最。九黎神柱是目前世界上高度最高、直径最大、雕刻鬼神像最多的苗族图腾柱；九黎宫是世界上最高最大的吊脚楼建筑体、也是世界上最大的四合院建筑体、最奇特的楼中楼阁与楼中殿堂建筑集群；九道门是目前世界上建有最多朝门的苗族建筑景观。</p><p>2月16日至2月21日，景区将举行蚩尤九黎城狗年·迎春系列活动，包括击鼓迎宾·拦门喝酒等活动，身着节日盛装的苗家阿哥、阿妹在九道门迎接游客，与游客互动对山歌，不对山歌的游客必须喝酒才能走进景区；苗家民俗展演，如高台狮舞、苗家彩龙船、苗家婚俗、苗家竹竿舞、苗家歌舞表演等；喝苗家美酒·品苗家长桌宴，景区在中午用餐时间将推出苗家长桌宴，长桌宴期间还有苗家阿哥阿妹着盛装唱歌敬酒等。</p><p><strong> 合川</strong></p><p><strong> 逛灯会赏杂技</strong></p><p>灯火辉映三江畔，火树银花不夜天。重庆日报记者从合川区旅游发展委了解到，第二届三江灯会正在该区花滩世纪乐都水乐园举行，该活动持续到3月18日，为游客精心打造了一台历史人文与现代科技相融合的视觉盛宴。</p><p>合川灯会历史悠久，清代就有“元宵张灯”习俗。本届灯会以合川三江文化为题材，共设计了60多组大中型灯组和水上灯组，分为三江文化、滨水休闲、合川记忆、童心童趣、合川火龙秀五大主题灯组。</p><p>灯会还邀请吴桥杂技大世界艺术团驻场演出，聘请“达瓦孜”第七代传人——艾尼外尔进行现场高空走钢丝表演，还有水幕电影、纱幕电影、文峰塔炫彩灯光秀及烟花秀表演、热气球升空观灯展等。</p><p><strong> 大足</strong></p><p><strong> 观佛灯艺术</strong></p><p>2月13日至5月4日，首届大足石刻国际佛灯艺术节将在大足区海棠湖公园举行。重庆日报记者从大足区获悉，届时市民不仅可以观赏到48组具有佛文化特色的超大型彩灯组，还可以参观大足石刻艺术展、达利与毕加索世界艺术展，在1000多件展品中感受中西文化的独特魅力。</p><p>大足石刻世界文化遗产旅游开发区管理委员会一负责人介绍，首届佛灯艺术节是迄今为止重庆地区规模最大、投资最多的一次佛文化灯会，将以更加惊艳、更接地气的方式宣传大足石刻，展现传统的中国文化和中国元素。</p><p>大足石刻国际佛灯艺术节门票为80元。其彩灯分为彩门灯组、陆地灯组、水上灯组和氛围灯组四种类型。最长灯组为长达45米的“华严三圣”，展现弘扬佛法的场景；最高的灯组为高18米的“大慈大悲”。</p>',NULL,'http://static.sopcloud.net/news/35610405780784.html?r=1517393357285',9220555351920,'2018-01-31 18:09:17','2018-01-31 18:09:17',9220555351920,''),(35610408076496,'每天都在用的家电有多脏，你知道吗？','一篇文章告诉你，为什么家电需要深度清洁。','2018-01-31 18:12:00',1,'社区活动',1,'http://oyzgunhd3.bkt.clouddn.com/FoKUtuBpPjamLtsY2-QIN0fc58Sj','<p><img src=\"http://oyzgunhd3.bkt.clouddn.com/FtdCcq7nlY6mWsgqxrvQNoVqqpu6\"></p><p><br></p><p><span style=\"color: rgb(62, 62, 62);\">厨房油烟机、空调、洗衣机等家电的清洁，一直以来就是比较棘手的问题。油渍堆积深厚就很难靠自己清洗干净，</span><span style=\"color: rgb(56, 53, 53);\">其实，跟我们朝夕相处的家电中，隐藏着不少的灰尘和污渍。如果不及时清洁养护，会留下很多安全及健康隐患。</span></p><p><br></p><p><strong>空调：需要定期清除灰尘污垢</strong></p><p><br></p><p><img src=\"http://oyzgunhd3.bkt.clouddn.com/FrJ04lhtTopHh-Etwr0OB9TpmECU\"></p><p><br></p><p><span style=\"color: rgb(56, 53, 53);\">空调在使用一定时间后，它的制热制冷效果会明显下降，而且空气经过过滤网、蒸发器等会使得一些灰尘、污垢、霉菌等等附着在上面。</span></p><p><br></p><p><span style=\"color: rgb(56, 53, 53);\">在密闭空间里使用，人体会持续各种身体不适的情况，特别是老人和儿童，他们的抵抗力较差，得病的几率会更大，如一些呼吸道感染疾病。</span></p><p><br></p><p><br></p><p><strong>油烟机：油网下的污渍多到你无法想象</strong></p><p><br></p><p><br></p><p><span style=\"color: rgb(56, 53, 53);\">选购一台便于清洁的油烟机有多重要，家中油烟机如果抽不走油烟，表面黏腻腻的油渍，如果长期不清洗，将直接导致使用寿命缩短、耗电量增加，并形成火灾隐患。</span></p><p><br></p><p><span style=\"color: rgb(62, 62, 62);\">有试验表明，3个月以上不清洗油烟机，油烟机负荷会加重，耗电增加30-50%。</span></p><p><br></p><p><span style=\"color: rgb(62, 62, 62);\">油烟机的滤油网、涡轮等部位油垢不清理，会造成油污积累，氧化积累酸性物质引发腐蚀和生锈，噪音加大，成为火灾源。</span></p><p><br></p><p><span style=\"color: rgb(62, 62, 62);\">叶轮烟道上的油污增加了粘性，导致排气不顺畅，以至于油烟在厨房扩散，危害健康。</span></p><p><br></p><p><br></p><p><strong>洗衣机：内胆清洁不可忽视</strong></p><p><br></p><p><img src=\"http://oyzgunhd3.bkt.clouddn.com/FgN954kJf25MUc1YUY9SCt8xvHFI\"></p><p><br></p><p><span style=\"color: rgb(56, 53, 53);\">有的人觉得洗衣机长期起到清洁的作用，和洗衣液洗衣粉长期接触，应该是最不需要清洁的家电，实际上恰恰相反，由于长时间的接触水和脏衣服，洗衣机内部的污垢反而更加严重。</span></p><p><br></p><p><span style=\"color: rgb(56, 53, 53);\">当洗衣时衣服上会沾上水垢痕迹的时候，就是洗衣机需要清洁的强烈信号，一般每三个月到半年的时间里最好对整个内胆进行一次彻底的清洁，以保证洗衣的干净。</span></p><p><br></p><p><br></p><p><strong>冰箱：消除难闻的异味</strong></p><p><br></p><p><br></p><p><span style=\"color: rgb(56, 53, 53);\">一年四季冰箱都在为人使用，其中滋生的病菌可想而知，密封条上附带的微生物危害着人体的健康。</span></p><p><br></p><p><span style=\"color: rgb(56, 53, 53);\">除霜所融化的水很难蒸发，再加上冰箱内各种食物的混装、混放等使得其中会产生一股难闻的异味，隔夜饭菜更容易沾染上细菌，对人体的身体健康极为不利。</span></p><p><br></p><p><br></p><p><strong>家电深度清洗一定要找专业机构</strong></p><p><br></p><p><span style=\"color: rgb(56, 53, 53);\">以往我们只知道自己动手把电器表面打扫干净，或者找找外面的街头游击队清洗下家里的油烟机和空调。对家电清洗还完全没有一个概念，而如今，正规的家电清洗服务机构已经开始进入你我的生活，已经开始融入我们生活的一部分。</span></p><p><br></p><p><span style=\"color: rgb(56, 53, 53);\">深度家电清洁使用专业清洗设备及清洗剂，能针对不同部件进行深入彻底清洗。服务规范，收费统一，避免了传统清洗方法的各种弊端。</span></p><p><br></p><p><img src=\"http://oyzgunhd3.bkt.clouddn.com/Fh5PYFQAJtOYiW-IaWF7HbTTTvGB\"></p><p><br></p><p><span style=\"color: rgb(56, 53, 53);\">春节就要到了</span></p><p><span style=\"color: rgb(56, 53, 53);\">为了给各位业主家电安全及健康保驾护航</span></p><p><span style=\"color: rgb(56, 53, 53);\">新鸥鹏物业隆重推出</span><strong style=\"color: rgb(56, 53, 53);\">家电深度清洗服务</strong></p><p><br></p><p><strong style=\"color: rgb(217, 33, 66);\">家电清洗年末爆款促销</strong></p><p><strong style=\"color: rgb(23, 54, 93);\">给家电来一次彻底的深度清洁！</strong></p><p><br></p><p><img src=\"http://oyzgunhd3.bkt.clouddn.com/FkNj1NXeWsjxoujlkNyA59OSexnt\"></p><p><br></p><p><strong style=\"color: rgb(2, 34, 83);\">预约方式：</strong></p><p><span style=\"color: rgb(2, 34, 83);\">1、拨打24小时人工客服：400 023 9922预约及咨询。</span></p><p><span style=\"color: rgb(2, 34, 83);\">2、新鸥鹏各物业服务中心咨询及预约（按预约时间安排上门服务）。</span></p><p><br></p><p><br></p><p><strong style=\"color: rgb(217, 33, 66);\">除旧迎新送好礼</strong></p><p><span style=\"color: rgb(56, 53, 53);\">凭家电清洗单据预约家政服务</span></p><p><span style=\"color: rgb(56, 53, 53);\">可直接减免家政服务费用</span></p><p><span style=\"color: rgb(56, 53, 53);\">消费满150元</span><strong style=\"color: rgb(56, 53, 53);\">减免15元</strong></p><p><span style=\"color: rgb(56, 53, 53);\">消费满280元及以上</span><strong style=\"color: rgb(56, 53, 53);\">减免30元</strong></p><p><span style=\"color: rgb(217, 33, 66);\">备注：现金减免只针对家政服务项目</span></p><p><br></p><p><strong style=\"color: rgb(56, 53, 53);\">快来选择我们的专业家电清洗</strong></p><p><strong style=\"color: rgb(56, 53, 53);\">给你的家电洗洗澡吧！</strong></p>',NULL,'http://static.sopcloud.net/news/35610408076496.html?r=1517393897391',9220555351920,'2018-01-31 18:14:04','2018-01-31 18:14:04',9220555351920,''),(35613751451504,'本周天气以晴为主 “立春”后天气仍然寒冷','根据市气象台预计，本周开始，天气会进一步好转，各地多云或多云间阴天，早上平坝河谷地区有雾，全市最高气温也将在13℃左右，主城最高12℃。','2018-02-05 14:17:00',1,'便民资讯',1,'http://oyzgunhd3.bkt.clouddn.com/FomgxLSSxcn6mfGAUMJFZYGhiql6','<p>重庆晨报讯 （记者 石亨）昨天，阳光的陪伴下，我们迎来今年的第一节气“立春”，不少市民纷纷出门，前往各大公园游玩赏梅。</p><p>过了午后，多地转为阴天，截至下午4点，大部分地区最高气温在3-10℃，璧山、忠县、丰都、万州、开州、巫溪6区县最高气温超过10℃，全市最高温10.8℃，主城最高气温9.7℃。</p><p><br></p><p>立春是二十四节气之首。古语有云，春气始而建立也。立春之后天气渐暖、冰雪消融、草木萌生。不过，“立春”并不代表春天真的来了。气象意义上的“入春”，通常将连续五天日平均气温稳定在10℃以上的开始日作为春季的开始。</p><p><br></p><p><img src=\"http://n.sinaimg.cn/cq/crawl/w399h600/20180205/SAZ7-fyrhcqy5493730.jpg\"></p><p><img src=\"http://n.sinaimg.cn/cq/crawl/w400h272/20180205/QcaL-fyrhcqy5493847.jpg\"></p><p><br></p><p>昨日，鸿恩寺公园，红梅花绽放报春，海棠花也次第开花，已是一派春的景象，市民们走出家门到公园踏青赏花。 本报记者 李斌 摄</p><p><br></p><p>重庆大部分地区常年入春时间大约在2月中旬开始直到3月初，偏东部分地区会更晚一些，如城口、黔江、酉阳等地会晚至3月中下旬。</p><p><br></p><p>根据市气象台预计，本周开始，天气会进一步好转，各地多云或多云间阴天，早上平坝河谷地区有雾，全市最高气温也将在13℃左右，主城最高12℃。</p><p><br></p><p>专家提醒，“立春”后天气仍然寒冷，市民仍要注意做好防寒保暖的措施。</p><p><br></p><p><strong>未来三天天气预报</strong></p><p>今天：各地多云到晴，平坝河谷地区早上有雾，大部分地区气温-1~14℃；主城：多云间晴，早上有轻雾，5~11℃。</p><p>明天：各地多云间晴，大部分地区气温-2~14℃；主城：多云间晴，5~12℃。</p><p>后天：东北部多云或多云间晴，其余地区阴天间多云，大部分地区气温0~12℃；主城：阴天间多云，6~9℃。</p>',NULL,'http://static.sopcloud.net/news/35613751451504.html?r=1517811566182',9220555351920,'2018-02-05 14:19:26','2018-02-05 14:19:26',9220555351920,''),(35615104377656,'关于冬季消防安全的温馨提示','冬季历来是火灾多发季节。由于气候干燥，天气寒冷，用火用电情况大量增加，起火原因增多，火灾危险性加大。为了加强冬季防火用电安全，提高业主们的消防安全知识，防患于未然。','2018-02-07 13:13:00',3,'',1,'','<p>尊敬的业主（住户）朋友：</p><p><br></p><p>大家好！冬季历来是火灾多发季节。由于气候干燥，天气寒冷，用火用电情况大量增加，起火原因增多，火灾危险性加大。为了加强冬季防火用电安全，提高业主们的消防安全知识，防患于未然。</p><p><br></p><p>物业服务中心温馨提示各位业主们特别注意以下几个方面：</p><p><br></p><p>一、防范火灾注意事项：</p><p>1) 请不要将烟头等易燃物品随处乱丢。消除火灾隐患，营造平安小区；</p><p>2) 请勿在户内储存易燃、易爆物品和使用煤炉，如：汽油、煤油、酒精、油漆、烟花爆竹等；</p><p>3) 请保持消防通道的畅通，禁止在单元楼道内堆放废弃物和停放车辆；</p><p>4) 外出时请关好门窗，不要在无人的情况下使用电热棒、电吹风、电磁炉等电器，注意人走切断电源。长时间外出时，请关闭水、电、气的总阀；</p><p>5) 燃气灶具要注重平时的保养，一旦发生管道破损漏气要及时维修。外出或睡觉前请检查电器是否断电，燃气阀门是否关闭；家中最好配有灭火系统如灭火器等，做到防患于未然；</p><p>6) 不要使用大功率电器，不要同时使用几种功率超过1000瓦的电器，以免线路超负荷引发火灾。切勿在家中乱拉、乱接电线，电路熔断器请不要用铜丝、铁丝代替。</p><p><br></p><p>二、紧急情况处理办法：</p><p>1) 如果您发现火灾安全隐患请立即通知物业服务中心；</p><p>2) 发现燃气泄漏，要迅速关闭气源阀门，打开门窗通风，切勿触动电器开关和使用明火，并迅速离开燃气泄漏区域，通知服务中心前往处理；</p><p>3) 家用电器或线路着火，要先切断电源，再用干粉或气体灭火器灭火，不可直接泼水灭火，以防触电或电器爆炸伤人；</p><p>4) 如火势渐大，非人力可控制，需当机立断请求支援，及时拨打119报警电话。报警时要讲清楚起火的详细地点（具体到房间号）、燃烧物及火势大小、是否有人被围困，最后留下姓名及联系电话。</p><p><br></p><p>为了您和家人的人身财产安全，让我们携手，群防群治，营造温馨、安全、和谐的美好家园！</p>',NULL,'http://static.sopcloud.net/news/35615104377656.html?r=1517980681959',9220555351920,'2018-02-07 13:18:02','2018-02-07 13:18:02',9220555351920,''),(35615105432472,'2018春节重庆主城烟花爆竹燃放须知','2018年2月15日至3月2日每日上午 7 时至次日凌晨1时，渝中区、大渡口区、江北区、沙坪坝区、九龙坡区、南岸区、北碚区、渝北区、巴南区、两江新区城区，可以在限制燃放区域内燃放烟花爆竹。','2018-02-07 13:18:00',2,'',1,'','<p>	2018年2月15日至3月2日每日上午 7 时至次日凌晨1时，渝中区、大渡口区、江北区、沙坪坝区、九龙坡区、南岸区、北碚区、渝北区、巴南区、两江新区城区，可以在限制燃放区域内燃放烟花爆竹。</p><p><br></p><p>	今年重庆主城八类区域和场所禁止燃放烟花爆竹：市、区国家机关办公区域；车站、码头、机场、轨道和站点、商场及其他人员密集场所；重要军事设施、仓库；文物保护单位；加油（气）站等存放易燃易爆物品的场所及其周边100米范围内；医院、幼儿园、养老院、疗养院；教学、科研单位的办公、教学、科研场所及学生宿舍；主城各区人民政府及两江新区管委会规定禁止燃放烟花爆竹的其他区域和场所。</p><p><br></p><p>	重庆市公安局治安总队枪爆支队烟花爆竹专管民警介绍，如在禁止燃放烟花爆竹的时间、地点燃放烟花爆竹，或者以危害公共安全和人身、财产安全的方式燃放烟花爆竹的，根据《烟花爆竹安全管理条例》第四十二条规定，公安部门将责令停止燃放，处100元以上500元以下的罚款；构成违反治安管理行为的，依法给予治安管理处罚。</p>',NULL,'http://static.sopcloud.net/news/35615105432472.html?r=1517980813748',9220555351920,'2018-02-07 13:20:14','2018-02-07 13:20:14',9220555351920,''),(35615108101896,'春节长途开车回家，必看事项！','再过几天就是春节了，各位开长途回家过年的朋友开车一定注意安全，以下需注意的地方，希望对您有所帮助！','2018-02-07 13:22:00',3,'',1,'','<p>再过几天就是春节了，各位开长途回家过年的朋友开车一定注意安全，以下需注意的地方，希望对您有所帮助！</p><p><br></p><p>一、检查轮胎</p><p>确保轮胎不存在异常磨损、鼓包、啃胎、扎钉等，确保轮胎胎压正常。跑长途轮胎是重中之重。</p><p><br></p><p>二、检查蓄电池，防止半路抛锚</p><p>2年以上的车要经常检查蓄电池状态。检查电瓶的充放电能力是否正常，正负极是否连接紧固。</p><p><br></p><p>三、检查刹车片</p><p>高速行驶，虽然不会非常频繁使用刹车，但跑高速前一定得仔细检查刹车系统，上到刹车油位，下到刹车片……当然，主要还是检查刹车片厚度，确保关键时刻能刹住！</p><p><br></p><p>四、检查灯光</p><p>如果需要跑夜路的朋友，一定要确保汽车的灯光正常，尤其是刹车灯、行车灯！！！至少让其它车辆能发现你……总之，安全第一。</p><p>&nbsp;</p>',NULL,'http://static.sopcloud.net/news/35615108101896.html?r=1517981147425',9220555351920,'2018-02-07 13:25:47','2018-02-07 13:25:47',9220555351920,''),(35617809237104,'文化部：公共图书馆等春节期间不休息 照常免费开放','谈及2018年春节期间文化活动安排，文化部副部长杨志今今日介绍，各级公共图书馆、文化馆和博物馆、美术馆等公共文化机构节日期间不休息，将照常免费向公众开放，为群众提供文化服务。','2018-02-11 11:10:00',1,'便民资讯',1,'http://oyzgunhd3.bkt.clouddn.com/Flsjzz-CGhGH89PLSk5vlkwPK14z','<p>     谈及2018年春节期间文化活动安排，文化部副部长杨志今今日介绍，各级公共图书馆、文化馆和博物馆、美术馆等公共文化机构节日期间不休息，将照常免费向公众开放，为群众提供文化服务。</p><p><br></p><p>     国务院新闻办公室今日举行新闻发布会，请商务部副部长王炳南、文化部副部长杨志今、国家旅游局副局长王晓峰介绍2018年春节消费市场运行保障、文化活动、假日旅游等方面情况，并答记者问。</p><p><br></p><p>     杨志今指出，文化部于春节期间组织42支文艺小分队赴各地开展“文化迎春，艺术为民”新春慰问活动200多场，并在革命老区、贫困地区开展多种类型的慰问活动。</p><p><br></p><p>     各地文化部门组织开展各类文艺汇演和城乡群众文化活动；依托传统习俗和特色民间文化艺术，举办各类庙会、花会等节庆活动。国家京剧院、中国儿童艺术剧院等9家中央直属艺术院团将在春节期间持续开展各类演出近200场，在京演出约100余场。</p><p><br></p><p>      此外，已部署开展部分地区农村演出市场专项整治行动，并将继续加强文化市场安全生产工作、互联网上网服务营业场所监管等，保障春节期间良好的文化市场环境。</p><p><br></p><p>     杨志今介绍到，2018年，文化部将继续在全球开展“欢乐春节”活动，通过高质量、多元化的文化活动，传递来自中国的新春问候。包括专场演出、春节庙会、广场庆典、非遗互动、校园联欢、文贸推介、美食品鉴等20多个类别在内的一大批高水准“欢乐春节”项目将在全球超过130个国家和地区的400多座城市陆续展开，包括53个“一带一路”沿线国家和地区。</p>',NULL,'http://static.sopcloud.net/news/35617809237104.html?r=1518318789329',9220555351920,'2018-02-11 11:13:09','2018-02-11 11:13:09',9220555351920,''),(35617811078984,'注意了！春节期间这些地方禁止燃放烟花爆竹','随着新春的脚步日益临近，喜庆的气氛也越来越浓，而燃放烟花爆竹也是这期间的一项“传统节目”。不过玩归玩，安全还是要注意。','2018-02-11 11:15:00',1,'社区动态',1,'http://oyzgunhd3.bkt.clouddn.com/FiCd_qVZwlLqYZkQ30EqbLDq9egv','<p>	随着新春的脚步日益临近，喜庆的气氛也越来越浓，而燃放烟花爆竹也是这期间的一项“传统节目”。不过玩归玩，安全还是要注意。10日上午，重庆主城区燃放烟花爆竹安全集中宣传日江北集中宣传点活动在观音桥举行，向广大市民普及燃放烟花爆竹安全知识，也发布了相关的管理通告，春节期间重庆市民在江北区燃放烟花爆竹，这些行为千万不能有。</p><p><br></p><p>	据了解，根据相关管理通告，市、区国家机关办公区域；车站、港口、码头、商场、轨道及站点，公墓、殡仪馆、宗教及其他人口密集场所；重要军事设施、仓库、文物保护单位；加油气（站）等存放易燃易爆物品的场所及周边100米范围内；医院、学校、幼儿园、敬老院等场所均不得燃放烟花爆竹。</p><p><br></p><p>	其中江北区大气环境监测点周边1000米范围内的场所；观音桥商业步行街道内区域（含北城天街）、国有和集体林区、民航航道禁空区；居民棚户区等也都不得燃放烟花爆竹。而石子山体育公园、鸿恩寺公园、江北嘴大剧院、江北嘴中央公园、寸滩观音寺、寸滩观音庙、铁山坪僧倌寺、郭家沱莲花寺、鱼嘴普渡寺、石门飞来寺公墓、郭家沱公墓、鱼嘴寺坪陵园更是做为重点看护对象，严禁任何单位、个人在场所内销售、燃放烟花爆竹。</p><p><br></p><p>	除去上述禁止燃放区域外，其他为限制燃放区域。而限制燃放烟花爆竹的时间，则是从2018年2月15日至3月2日，每日上午7时至次日凌晨1时，可以在限制燃放区域内燃放烟花爆竹。但限制燃放区域内允许销售、燃放的品种为C级和D级产品中的喷花类、旋转类、玩具类（烟雾型、摩擦型除外）、爆竹类（“土火炮”、“大夹小”和“炮中炮”爆竹产品除外）、升空类（火箭、旋转烟花产品除外）、组合烟花类6大类。禁止销售和燃放礼花弹、架子烟花、小礼花、吐珠烟花产品和单发药量大于25ｇ、内径大于30mm（1.2〞）的内筒型组合烟花等专业燃放类产品，以及擦炮、摔炮、药粒型吐珠产品。未取得公安机关《烟花爆竹许可证》和单位和个人不得以任何形式组织大型焰火燃放活动。</p><p><br></p><p>	重庆市烟花爆竹燃放办公室提醒，为了自身和社会安全，市民要到合法点购买正规烟花爆竹产品，并按照产品“燃放说明”在规定时间、地点燃放。如遇空气重度污染时，各烟花爆竹销售点必须停止销售，市民也应自觉停止燃放。对违反相关法律法规和通告规定的行为，依法追究当事人责任。构成犯罪的，依法追究刑事责任。</p><p><br></p><p>	华龙网记者 董进</p>',NULL,'http://static.sopcloud.net/news/35617811078984.html?r=1518319019560',9220555351920,'2018-02-11 11:17:00','2018-02-11 11:17:00',9220555351920,''),(35617812147816,'春节高速免费 重庆车流总量将达1000万辆次','2月9日，来自重庆市交委的消息称，2月15日0:00至2月21日24:00，高速公路7座以下（含7座）载客车辆通行高速公路免收车辆通行费。免收通行费时间以车辆驶离高速公路出口车道的时间为准。','2018-02-11 11:17:00',1,'便民资讯',1,'http://oyzgunhd3.bkt.clouddn.com/FvC2hUVd_1FB6X_eqiskZE7WZ379','<p>	2月9日，来自重庆市交委的消息称，2月15日0:00至2月21日24:00，高速公路7座以下（含7座）载客车辆通行高速公路免收车辆通行费。免收通行费时间以车辆驶离高速公路出口车道的时间为准。</p><p><br></p><p>	春节长假期间，全市高速公路ETC收费车道依然保持ETC车辆专用通道状态。办理ETC业务的7座及以下小型客车通行ETC车道，同样享受免费政策。免费时限结束前，7座及以下小型客车可就近选择出口下道，享受免费政策。</p><p><br></p><p>	市交委预测，受高速公路小型车免费通行影响，预计2018年春节长假期间，<strong>重庆高速公路车流总量在1000万辆次左右，日均车流量约143万辆次</strong>。</p><p><br></p><p>	从主城高速公路9个主线收费站车流量来看，受G5013沙坪坝主线站无连接内环快速通道影响，<strong>预计春节长假期间，G5013沙坪坝主线站车流量最小</strong>，大部分前往G5013渝蓉高速车辆将选择G93沙坪坝上高速后经绕城高速至渝蓉高速。预计G93沙坪坝主线站车流量大，G75巴南、G85九龙坡、G75北碚、G50江北、G65巴南主线站车流量较大，G50S南岸、G65渝北主线站车流量较小，G5013沙坪坝主线站车流量最小。</p><p><br></p><p>	川渝通道。重庆往四川现有线路10条，其中射线7条（渝邻、渝广、渝武、渝遂、渝蓉、成渝、渝泸），连线3条（恩广高速万州至达州段、沪蓉高速垫江至邻水段、张南高速梁平至大竹段）。<strong>预计成渝、渝遂、渝武车流量较大，易出现拥堵，渝广、渝蓉车流量相对较小</strong>。</p><p><br></p><p>	渝鄂通道。重庆往湖北现有线路5条，其中射线2条（沪渝、沪渝南线），连线高速3条（沪蓉高速梁平至巫山段、张南高速黔江至恩施段、恩广高速万州至利川段）。<strong>预计沪渝高速重庆至长寿段车流量较大，易出现拥堵，沪渝南线车流量较小，可选择通行</strong>。</p><p><br></p><p>	渝贵通道。重庆往贵州方向现有线路4条，其中射线1条（渝黔），连线3条（南道、酉沿、秀松）。<strong>预计渝黔高速重庆至綦江段车流量较大，易出现拥堵，南道、酉沿车流量较小，不易出现拥堵情况。</strong></p><p><br></p><p>	渝湘通道。重庆往湖南现有线路1条（渝湘高速），<strong>预计重庆至南川段车流量较大易出现拥堵，秀松高速车流量较小不易出现拥堵情况</strong>。</p><p><br></p><p>	重庆日报记者 杨永芹</p>',NULL,'http://static.sopcloud.net/news/35617812147816.html?r=1518319153164',9220555351920,'2018-02-11 11:19:13','2018-02-11 11:19:13',9220555351920,''),(35626756411968,'重庆机场春节假期迎送旅客近87万人次','23日，记者从重庆机场方面了解到，刚过去的春节假期里，重庆机场共起降航班5765架次，同比增长5.68％，运送旅客近87万人次，同比增长8.84％，日均进出港旅客超12万人次，机场整体运行安全、平稳。','2018-02-24 09:36:00',1,'便民资讯',1,'http://oyzgunhd3.bkt.clouddn.com/Fg6da_V6w4WQ1zZr6M-MtqcOMDgO','<p class=\"ql-align-justify\">	 23日，记者从重庆机场方面了解到，刚过去的春节假期里，重庆机场共起降航班5765架次，同比增长5.68％，运送旅客近87万人次，同比增长8.84％，日均进出港旅客超12万人次，机场整体运行安全、平稳。</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">	据重庆机场方面介绍，春节长假期间，进出重庆机场的旅客大多以探亲和旅游为主。国内方面，出行集中在深圳、广州、北京、昆明、上海等地。国际和地区方面，集中在普吉、曼谷、中国香港、中国台湾等地。</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">	2月20日，重庆机场迎来返程高峰，全天起降航班855架次，返程高峰预计将持续到2月25日前后。</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">	据重庆机场方面预测，春运40天，重庆机场预计起降航班3.3万架，迎送旅客495万人次，日均旅客吞吐量约12.4万人次。</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">	数据显示，重庆机场出港航班票价从元宵节开始回落，前往昆明、贵阳、西安等地的机票价格低至2折，市民错峰出行将有更多选择。</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">（新闻来源：	<span style=\"color: rgb(64, 64, 64);\">华龙网</span>）</p>',NULL,'http://static.sopcloud.net/news/35626756411968.html?r=1519437186277',9220555351920,'2018-02-24 09:53:06','2018-02-24 09:53:06',9220555351920,''),(35626783324080,'春节吃得太油腻怎么办？看看这10大超强“刮油”食物！','春节期间，大家忙着走亲访友，各种饭局接踵而来，往往会吃得太油腻，然后就应了那句“每逢佳节胖三斤”！  下面就给大家介绍几种“刮油”小能手！','2018-02-24 10:47:00',1,'生活百科',1,'http://oyzgunhd3.bkt.clouddn.com/Fokwe2RI_5o0v0XKCmTWDS5gHfpT','<p>春节期间，大家忙着走亲访友，各种饭局接踵而来，往往会吃得太油腻，然后就应了那句“每逢佳节胖三斤”！</p><p>下面就给大家介绍几种“刮油”小能手！</p><p><br></p><p><strong>1.山药</strong></p><p>山药可促进消化功能，减少皮下脂肪沉积。</p><p><br></p><p><img src=\"http://5b0988e595225.cdn.sohucs.com/images/20180224/de86516e83f54d9699f22a9dc5817091.jpeg\" width=\"670px\"></p><p><br></p><p><strong>2.地瓜</strong></p><p>地瓜所含的纤维质松软易消化，可促进肠胃蠕动，有助于排便。</p><p><br></p><p><img src=\"http://5b0988e595225.cdn.sohucs.com/images/20180224/644f0ed3d78843058b67bfb312655c0c.jpeg\" width=\"auto\"></p><p><br></p><p><strong>3.洋葱</strong></p><p>洋葱能促进肠胃蠕动，加强消化能力，且含有丰富的硫，能较好地和蛋白质结合，对肝脏特别有益。</p><p><br></p><p><img src=\"http://5b0988e595225.cdn.sohucs.com/images/20180224/11cf3ed6d9904daa9a73467f85f525a2.jpeg\" width=\"auto\"></p><p><br></p><p><strong>4.海带</strong></p><p>海带中的褐藻胶因含水率高，在肠内能形成凝胶状物质，故能缓解便秘。</p><p><br></p><p><img src=\"http://5b0988e595225.cdn.sohucs.com/images/20180224/033b539a500a4e7ba126b718ece74a27.jpeg\" width=\"670px\"></p><p><br></p><p><strong>5.绿豆</strong></p><p>中医认为绿豆可解百毒，能促进机体的正常代谢。</p><p><br></p><p><img src=\"http://5b0988e595225.cdn.sohucs.com/images/20180224/0df5d6f440aa4cf1a15be2c500ffc3a3.jpeg\" width=\"auto\"></p><p><br></p><p><strong>6.莲藕</strong></p><p>莲藕的利尿作用，能促进体内废物快速排出。</p><p><br></p><p><img src=\"http://5b0988e595225.cdn.sohucs.com/images/20180224/76af4b4a2834461cb121f785c8f97760.jpeg\" width=\"670px\"></p><p><br></p><p><strong>7.薏米</strong></p><p>薏米可促进体内血液循环、水分代谢，发挥利尿消肿的效果，有助于改善水肿型肥胖。</p><p><br></p><p><img src=\"http://5b0988e595225.cdn.sohucs.com/images/20180224/1939286ecafa40959547329d55699cd2.jpeg\" width=\"auto\"></p><p><br></p><p><strong>8.白菜</strong></p><p>如果想要最快控油排油的话，最好是吃水煮白菜。只需要加入淡淡的盐粒就可以了。</p><p><br></p><p><img src=\"http://5b0988e595225.cdn.sohucs.com/images/20180224/3f45f92853014f2aa4a70a12ffa5273a.jpeg\" width=\"auto\"></p><p><br></p><p><strong>9.苹果</strong></p><p>苹果是很不错的水果，而且热量比较低。苹果里含有丰富的膳食纤维和果胶，它们经过人体时，总会带走点什么，比如脂肪 、油脂。</p><p><br></p><p><img src=\"http://5b0988e595225.cdn.sohucs.com/images/20180224/bfe14618d4a14b0f865da13e058deb63.jpeg\" width=\"auto\"></p><p><br></p><p><strong>10.银耳</strong></p><p>银耳滋而不腻，为滋补良药，还富含膳食纤维，可加强胃肠蠕动，减少脂肪吸收。</p><p><br></p><p><img src=\"http://5b0988e595225.cdn.sohucs.com/images/20180224/7bde2d5857394b87b6a515cec5d2a307.jpeg\" width=\"670px\"></p>',NULL,'http://static.sopcloud.net/news/35626783324080.html?r=1519441160012',9220555351920,'2018-02-24 10:49:10','2018-02-24 10:49:10',9220555351920,''),(35626861593904,'春季如何预防感冒?','','2018-02-24 13:31:00',3,'',1,'','<p><strong>导读</strong>: 每年的春季都是感冒的常发季节，感冒、发烧、打喷嚏，不时在身边发生。感冒虽然是小病，但是也不能不吃药，乱吃药。春季4种情况很容易感冒，春季如何预防感冒呢？下面跟小编一起来看看。……</p><h2 class=\"ql-align-center\"><strong>	</strong></h2><h2 class=\"ql-align-center\"><strong>春季4种情况容易感冒</strong></h2><p class=\"ql-align-center\"><br></p><p>	1、温度骤变时</p><p><br></p><p>	每当换季或是温度变化比较大时，感冒就容易找上门。天冷时，人的毛孔会收缩，进而抵御冷空气的侵袭；天热时，毛孔会舒张排汗以散热。但温度变化大，忽冷忽热的天气下，人体的自我调节跟不上，就可能患上感冒。因此在换季时要注意及时增减衣物，加强锻炼。此外，人在适应新地方时，也有可能因环境温度的骤然变化而抵抗力下降。</p><p><br></p><p class=\"ql-align-center\">	<img src=\"http://img.cnys.com/upload/picture/2016/02-26/jJBTpT.png\"></p><p>	2、服某些药时</p><p><br></p><p>	长期使用激素或者长期使用一些免疫抑制剂，可能会影响人体自身的免疫力，使身体对感冒病毒的抵抗力变弱。若已经服用上述药物较长时间，建议平时注意不要和患感冒的人有过于密切的接触，以免被传染，特别是流感高发的冬季，尽量不去人群密集的地区，平时多锻炼，尽可能提高自身抵抗力。</p><p><br></p><p>	3、太忙的时候</p><p><br></p><p>	节奏快的都市生活，时不时就会让人忙得忘记吃饭，睡不好觉。过于疲劳导致免疫力下降，此时如果遇到流感病毒，人们就很容易中招。有时，工作繁忙带来的压力会影响到人的情绪，进而导致免疫系统受到影响，致使抵抗力下降。因此，忙碌的时候尽量保证规律饮食，多找机会休息，不要选择泡吧、喝酒这样的放松方式。另外，忙过一阵子后，一定要调整作息，让生活回到正轨，休养生息。</p><p><br></p><p>	4、室内人群密集时</p><p><br></p><p>	无论是办公室，还是商场、影院等室内场所，如果人群过于密集，就会加大感冒的传染风险。一旦有人打一个喷嚏，其他人就被暴露在了感冒的危险中。如果工作环境难以改变，就要自觉地多走出去，尽可能多去户外活动。</p><p><br></p><p>	专家称，患有糖尿病、慢阻肺等慢病的人，也是感冒易发人群。糖尿病病人由于代谢功能紊乱、机体的抵抗力下降，容易受到外界环境的影响；慢阻肺患者因为肺功能减弱，对感冒也十分敏感，需特别小心。</p>',NULL,'http://static.sopcloud.net/news/35626861593904.html?r=1519450333926',9220555351920,'2018-02-24 13:32:14','2018-02-24 13:32:14',9220555351920,''),(35632995031488,'一个看颜值的时代，TA却靠“丑”走红','接下来登场的这位主角，没颜值没身材，却依旧火得一塌糊涂，到底是怎么回事？','2018-03-05 10:27:00',1,'社区活动',1,'http://oyzgunhd3.bkt.clouddn.com/FqTPT-tnFn9unneDQ4BFYwl3_YAw','',NULL,'https://mp.weixin.qq.com/s?__biz=MzA5NDkyMzExMg==&mid=2649358978&idx=4&sn=440d2b5259ec7bac13aab7d9e348a470&chksm=88599285bf2e1b93c921e5bf8e7eff90ef0900ed4b769b6c40fe37f86310d03bafbfb941cee4#rd',9220555351920,'2018-03-05 10:30:14','2018-03-05 10:30:14',9220555351920,''),(35632998233576,'小细节大文明：文明养宠篇','养成文明、科学饲养宠物的好习惯，会让我们的生活环境变得更加和谐、美好！','2018-03-05 10:33:00',3,'',1,'','<p>饲养宠物可以调剂人的情感，给人带来愉快、活力和希望，增添生活乐趣。但随着宠物的增多，也给居民的日常生活带来了许多不良影响，如宠物伤人、排泄物污染环境、叫声扰民。养成文明、科学饲养宠物的好习惯，会让我们的生活环境变得更加和谐、美好！</p><p><br></p><p><strong>饲养宠物必须守法，别忘了，依法办理相关手续。</strong></p><p><br></p><p>饲养宠物必须自觉、严格遵守国家相关法律法规，禁止饲养国家法律法规不允许饲养的宠物，依法依规办理饲养宠物的相关手续。</p><p><br></p><p><strong>关爱宠物健康也是关爱自己，别忘了，定期为宠物注射疫苗做体检。</strong></p><p><br></p><p>每年定期为宠物注射相关疫苗，进行常规体检，未注射疫苗的宠物不得交易。关爱宠物健康，也是对您和他人的健康负责。</p><p><br></p><p><strong>宠物也有尊严，别忘了，不要随意虐待。</strong></p><p><br></p><p>养宠物，不仅仅是一种乐趣，更是一种甜蜜的责任。请照顾好您的宠物，提供必要的养育、护理、训练及医疗条件。请不要随意虐待、遗弃它们。</p><p><br></p><p><strong>外出遛狗要栓牢，别忘了，远离老人和小孩。</strong></p><p><br></p><p>外出遛狗时请使用牵引带，尽量为它们戴上嘴套，防止它们“出口”伤人。请尽量少带其出入公共场所，与老人小孩保持1—2米的距离。</p><p><br></p><p><strong>随地便溺不文明，别忘了，及时清理排泄物。</strong></p><p><br></p><p>请尽量避免宠物在公共场所随地便溺，如宠物在公共区域内便溺，请您及时清理其排泄物并妥善处置。</p><p><br></p><p><strong>清晨夜间保持安静，别忘了，避免宠物狂吠扰民。</strong></p><p><br></p><p>请看管好您的宠物，不要让它们狂吠，特别是清晨和夜间，避免影响他人的正常生活，正确对待邻居的合理建议。</p><p><br></p><p><strong>有人可能害怕犬，别忘了，乘坐电梯要远离。</strong></p><p><br></p><p>乘坐电梯时，尽量抱起您的爱犬，如同乘人害怕，应礼貌退出，等候下一部电梯。</p><p><br></p><p><strong>宠物增长过快要控制，别忘了，给它们进行绝育手术。</strong></p><p><br></p><p>在有必要的情况下，给宠物进行绝育手术，以避免宠物的数量增长过快。</p><p><strong>不要遗弃宠物，别忘了，帮它找新主人。</strong></p><p><br></p><p>请不要遗弃宠物。一旦发生因移民、搬迁、生育等不得不放弃养宠的情况，请提前为它们寻找可靠的新主人。</p><p><strong>做个文明养宠人，别忘了，努力影响身边人。</strong></p><p><br></p><p>作为宠物的主人，请您积极推广文明养宠理念、认真学习科学养宠知识、热心创意爱宠公益活动，做文明养宠人。当遇到不文明的养宠人，要晓之以理，动之以情，尽量影响他向文明养宠看齐。</p><p><br></p><p>不积跬步无以至千里；不积小流无以成江海。文明细节虽小却是“天大的小事”，唯有从点滴小事做起，我们才能让文明在全社会蔚然成风。</p>',NULL,'http://static.sopcloud.net/news/35632998233576.html?r=1520217413900',9220555351920,'2018-03-05 10:36:54','2018-03-05 10:36:54',9220555351920,''),(35633003268960,'怎样预防春季病菌','春季是万物生长的季节，也是病菌疯狂滋生的季节。稍不注意这些可恶的病菌就会趁虚而入，那么，怎样预防春季病菌呢？','2018-03-05 10:46:00',3,'',1,'','<p>	<span style=\"color: rgb(51, 51, 51);\">怎样预防春季病菌？春季是万物生长的季节，也是病菌疯狂滋生的季节。稍不注意这些可恶的病菌就会趁虚而入，那么，怎样预防春季病菌呢？小编来给您支招。</span></p><p><br></p><p><br></p><p><strong style=\"color: rgb(51, 51, 51);\">怎样预防春季病菌</strong></p><p><br></p><p>1、清洗常触碰的东西</p><p><br></p><p>我们对手机、微波炉、键盘、门把手、电灯开关、床栏杆、遥控器、儿童玩具、沙发等经常触碰的物品很少清洗,但它们却是病菌最喜欢的地方。因此,在每周例行打扫中,可以用肥皂和水或者以酒精为主要成分的擦拭液对它们进行清洁,防止病菌传播。此外,细菌喜欢温暖、黑暗、潮湿的地方,因此洗衣机常成为细菌的藏匿之地。为清除细菌,可在洗衣机清洁剂注入口倒入两大汤匙的白醋,启动清洗模式。</p><p><br></p><p>2、减少糖分摄入量</p><p><br></p><p>科学表示,不吃糖分高的食物会使人更精神,还能避免生病,因为糖分会抑制白细胞吞噬病菌的能力。所以,在流感季尤其要注意抵制甜食,每天糖分摄入量女性少于6茶匙、男性少于9茶匙最佳。</p><p><br></p><p>3、 不咬指甲</p><p><br></p><p>除非时常洗手、清洗手机和键盘,否则我们的手指很可能满是细菌,易对身体“入口”造成感染,如眼睛、鼻子、咽喉等。细菌会在指甲下集聚,咬指甲、常揉眼睛等容易让细菌进入体内。</p><p><br></p><p>4、打流感疫苗</p><p><br></p><p>预防病菌的首要措施就是注射流感疫苗。老人、小孩以及患有糖尿病等慢性病的人群最应该注射。老人和小孩的体质较弱,患上流感后果就会十分严重。而一些患有慢性基础疾病的患者,如糖尿病、肺部疾病等,由于平时体质较差,一旦患上流感就会发生一些严重的并发症。</p><p><br></p><p><strong>春季病菌滋生，如何增强抵抗力</strong></p><p><br></p><p>1、及时增减衣物</p><p><br></p><p>春季气候多变,时冷时热,很多人认为裹严实了,才能保证不受风,不会得感冒。其实,裹得太严实不仅不能保证不得病,而且也失去了户外活动的意义。适宜的穿着对“户外游”是非常重要的,稍稍感受外界的气温变化可以刺激免疫系统,提高抵抗力。因此,在穿着适宜衣物的同时,还应该注意适量增减衣物,切莫多汗或受凉。</p><p><br></p><p>2、注意均衡膳食</p><p><br></p><p>外出时,要注意饮食温度以及卫生,切莫太过油腻以免消化不良。而在平时,就可以通过饮食帮助增强抵抗力。菌菇、黄绿色蔬菜、薏米、山药、番茄、豆制品等都富有营养,有助于增强抵抗力。</p><p><br></p><p>3、保证充足的睡眠</p><p><br></p><p>睡眠不良会让体内负责对付病毒和肿瘤的T细胞数目减少,生病的机率随之增加。专家建议每天需要7-8小时的睡眠。</p><p><br></p><p>4、近大自然，远离拥挤人群</p><p><br></p><p>人口密度越大的地方受到疾病感染的几率就越大。春暖花开之时,应尽量去绿化比较好的地方。新鲜的空气和充足的阳光,能够带来良好的刺激,提高抵抗力。</p><p><br></p><p>5、 不要随意使用抗生素</p><p><br></p><p>当感染不是很严重时,尽量不要用抗生素,而是靠自身的抵抗力,使免疫系统得到锻炼。这样当下次再遇到同样的“敌人”时,已经训练过的免疫细胞便会产生出有针对性的免疫力,从而保护身体安全。</p>',NULL,'http://static.sopcloud.net/news/35633003268960.html?r=1520218043307',9220555351920,'2018-03-05 10:47:23','2018-03-05 10:47:23',9220555351920,''),(35637871499064,'在重庆团，习近平总书记为领导干部讲授“政德”课','3月10日，习近平总书记参加重庆代表团审议。他在会上所作的重要讲话，相当于为党员干部上了一堂“政德课”。新华社《学习进行时》原创品牌栏目“讲习所”推出文章，与您一起学习。','2018-03-12 11:47:00',1,'便民资讯',1,'http://oyzgunhd3.bkt.clouddn.com/FhhYGlE8BDF7WE0abtYIDp_gOIsk','',NULL,'http://news.163.com/18/0311/14/DCKHFLA000018AOQ.html',9220555351920,'2018-03-12 11:49:32','2018-03-12 11:49:32',9220555351920,''),(35652458404520,'2018世界卫生日：全民健康覆盖','全民健康覆盖','2018-04-02 14:18:00',3,'',1,'','<p><span style=\"color: rgb(102, 102, 102);\">2018年4月7日，人们将迎来一年一度的世界卫生日，今年的世界卫生日的关键词是“全民健康覆盖”，届时将围绕这一主题倡议世界各国举行相关纪念活动。那么今天就为你介绍，2018年世界卫生日的基本情况。</span></p><p><br></p><p><strong>活动概述</strong></p><p><strong> </strong>世界卫生组织的基本原则是，所有人都应能够享有获得最高健康水平的权利。“人人享有卫生保健”是七十多年来世界卫生组织孜孜以求的目标，也是全组织当前支持各国推进全民健康覆盖的动力。</p><p><br></p><p>经验一再表明，只要有强烈的政治意愿，就可以实现全民健康覆盖。</p><p><br></p><p>因此，在世卫组织成立70周年之际，世卫组织呼吁世界各国领导人兑现其在2015年商定可持续发展目标时作出的承诺，致力于采取具体措施增进所有人的健康。这意味着确保人人都能获得基本的良好卫生服务，不会因此面临经济困难。</p><p><br></p><p>世界卫生组织将在2018年开展一系列活动重点关注全民健康覆盖工作，自4月7日世界卫生日开始，就如何实现人人享有卫生保健开展全球对话和地方对话。</p><p><br></p><p><strong style=\"color: rgb(0, 0, 0);\">全民健康覆盖为何重要</strong></p><p><strong style=\"color: rgb(255, 0, 0);\"> </strong>国家投资于全民健康覆盖，相当于对人力资本进行合理投资。近几十年来，全民健康覆盖战略已成为实现其他与健康相关的更广泛发展目标的一项重大战略。获得基本的良好卫生服务和财务保障不仅能改善人们的健康和提高预期寿命，还能增强国家抵御流行病的能力，减少贫困和饥饿风险，创造就业机会，推动经济增长，并促进两性平等。</p><p><br></p><p><strong>世界卫生日的作用</strong></p><p><strong> </strong>一些国家已在全民健康覆盖方面取得了重大进展。但世界上仍有一半人口无法获得所需的卫生服务。如果各国要实现可持续发展目标，到2023年，全民健康覆盖人口需要新增十亿人。</p><p><br></p><p>世界卫生日将强调全民健康覆盖的必要性及其益处。为发挥世界卫生日的作用，世卫组织及其合作伙伴将指明可以采取何种措施在各级开展活动和对话。</p><p><br></p><p>世卫组织总干事指出，“不应让任何人在死亡和经济困难之间做出选择，也不应让任何人在购买药物和购买食物之间做出选择”。</p><p><br></p><p><strong>2018年期间，世界卫生组织的目标是鼓舞、激励和引导各利益攸关方承诺推动全民健康覆盖：</strong></p><p><br></p><p><strong> </strong>鼓舞：强调政策制定者有大幅改善卫生状况的权力，向其说明这是一项令人振奋的巨大挑战，并促请他们参与变革。</p><p> 激励：通过分享一些国家推进全民健康覆盖的实例，鼓励其他国家向此方向迈进。</p><p><br></p><p> 引导：提供开展有序政策对话的工具，指导如何在国内推进全民健康覆盖或支持其他国家开展这方面努力（如扩大服务范围，提高服务质量，减少直接付款等）。</p><p><br></p><p><strong>主题、口号和话题标签</strong></p><p><strong> </strong>世界卫生日的主题是“全民健康覆盖：每一个人，每一个地方”。</p><p> 口号是“人人享有卫生保健”。</p><p> 世界卫生组织使用的主要标签是＃人人享有卫生保健＃，可以通过＃世界卫生日＃搜索相关帖子。</p>',NULL,'http://static.sopcloud.net/news/35652458404520.html?r=1522649935350',9220555351920,'2018-04-02 14:18:55','2018-04-02 14:18:55',9220555351920,''),(35652481142232,'重磅！中国对美国128项进口商品加征关税','关税','2018-04-02 15:03:00',1,'便民资讯',1,'http://oyzgunhd3.bkt.clouddn.com/FmkFJ73NTroMFFqJIFy6BzpnMAJg','',NULL,'http://news.163.com/18/0402/00/DEBJF3F40001875N.html',9220555351920,'2018-04-02 15:06:17','2018-04-02 15:06:17',9220555351920,''),(356524